import React, { useEffect, useState } from 'react';
import Axiosinstance from '../../config/Axiosinstances';
import List from './bookings';
import { useNavigate } from 'react-router-dom';
import Nobooking from './Nobooking';

function Mybooking() {
    const [bookings, setBookings] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        getMybookingsData();
    }, []);

    const getMybookingsData = () => {
        Axiosinstance.get('/users/getMybookingsData')
            .then((res) => {
                setBookings(res.data);
            })
            .catch((err) => {
                console.log(err);
                if (err.response.data.message === 'unauthorized user') {
                    localStorage.clear();
                    navigate('/');
                }
            });
    };

    const handleDeleteBooking = (id) => {
        // Update state by filtering out the deleted booking
        setBookings(prevBookings => prevBookings.filter(booking => booking.id !== id));
    };

    return (
        <div>
            {bookings.length > 0 ? (
                bookings.map((booking) => (
                    <List key={booking.id} bookingData={booking} onDelete={handleDeleteBooking} />
                ))
            ) : (
                <Nobooking />
            )}
        </div>
    );
}

export default Mybooking;
